import pystray
from pystray import MenuItem as item
from PIL import Image, ImageDraw
import io
import requests
import pygetwindow as gw
import psutil
import time
import win32gui
import win32process
import threading
import webbrowser
import atexit
import win32api
import win32con
import base64

# 服务器URL
SERVER_URL = "YourServerIP:9010/set"
SECRET = "YourSecret"  # 用于验证的密钥

# 设定特殊程序名及对应返回的预设值
SPECIAL_APP_NAMES = {
    "QQ.exe": "QQ",
    "WeChat.exe": "微信"
}

# 这里可以设置一些隐私信息的替换，比如服务器公网IP
replace_dict = {
    "YourServerIP": "不给看",
}

# 图标的 Base64 编码字符串（由static/miku_peek.png转码而来）
ICON_BASE64 = """

"""

# 将 Base64 编码字符串转换为图像
def base64_to_image(base64_str):
    # 修复 Base64 字符串的填充
    padding = len(base64_str) % 4
    if padding:
        base64_str += '=' * (4 - padding)

    # 解码 Base64 字符串
    image_data = base64.b64decode(base64_str)
    image = Image.open(io.BytesIO(image_data))
    return image


# 右键菜单回调
def on_quit(icon, item):
    print("Exiting program, uploading status=1 (No Application running).")
    upload_foreground_app("没开电脑")  # 上传退出时的状态
    stop_monitoring.set()  # 停止监控线程
    icon.stop()  # 退出任务栏图标


def on_similar(icon, item):
    webbrowser.open('yoursite') # 这里可以设置打开自己的网址


def get_foreground_app():
    try:
        # 获取当前前台窗口的标题
        window = gw.getWindowsWithTitle(gw.getActiveWindowTitle())[0]
        hwnd = window._hWnd  # 获取窗口的句柄

        # 使用 win32process 获取进程 ID
        _, pid = win32process.GetWindowThreadProcessId(hwnd)

        # 使用 psutil 获取进程名称
        process = psutil.Process(pid)
        process_name = process.name()  # 获取进程名称

        # 检查是否是特定的程序名称，若是，则返回预设值
        if process_name in SPECIAL_APP_NAMES:
            return SPECIAL_APP_NAMES[process_name]
        else:
            # 获取窗口标题并进行替换
            window_title = window.title
            # 遍历替换字典，替换窗口标题中的指定字符串
            for target, replacement in replace_dict.items():
                window_title = window_title.replace(target, replacement)
            return window_title
    except Exception as e:
        print(f"Error getting foreground app: {e}")
        return None


def upload_foreground_app(current_app, status=0):
    # 上传到服务器
    params = {
        'secret': SECRET,
        'status': status,  # 使用传入的 status 参数
        'app_name': current_app,
        'device_type': 'computer'  # 表明是电脑端上传
    }
    try:
        print(f"Uploading: {params}")  # 打印上传的参数
        response = requests.get(SERVER_URL, params=params)
        print(f"Uploaded app name: {current_app}, Response: {response.text}")
        print(f"Response status code: {response.status_code}")  # 打印响应状态码
    except Exception as e:
        print(f"Error uploading: {e}")


def monitor_foreground_app():
    last_app = None  # 用于保存上次的前台应用
    while not stop_monitoring.is_set():  # 使用 stop_monitoring 来控制线程退出
        app_name = get_foreground_app()
        if app_name:
            # 如果当前应用和上次应用不同，则上传新的应用信息
            if app_name != last_app:
                print(f"Foreground app changed: {app_name}")
                upload_foreground_app(app_name)
                last_app = app_name  # 更新上次的应用名
        else:
            # 如果没有前台应用，上传状态1
            if last_app != "No Application":
                print("No application is currently running.")
                upload_foreground_app("No Application")
                last_app = "No Application"  # 更新为没有应用的状态

        time.sleep(1)  # 每秒检查一次前台应用


# 停止线程
stop_monitoring = threading.Event()


def create_menu():
    return (item('似了吗', on_similar),
            item('退出', on_quit))


def exit_program():
    # 在程序退出时上传状态，表示没有应用运行
    print("Exiting program, uploading status=1 (No Application running).")
    upload_foreground_app("没开电脑", status=1)  # 将状态设置为 1 表示没有应用在运行


# 注册退出时执行的函数
atexit.register(exit_program)


# 注册Windows关机事件
def handle_shutdown(signal, frame):
    print("Shutdown signal received. Uploading status=1 (No Application running).")
    upload_foreground_app("没开电脑", status=1)  # 上传关机时的状态
    stop_monitoring.set()  # 停止监控线程
    exit_program()  # 确保退出时上传状态


# 监听 Windows 关机信号
win32api.SetConsoleCtrlHandler(handle_shutdown, True)


def main():
    print("Starting application monitor...")

    # 使用 Base64 解码并加载图标
    icon = pystray.Icon("test_app", icon=base64_to_image(ICON_BASE64), menu=create_menu())

    # 启动监控线程
    monitor_thread = threading.Thread(target=monitor_foreground_app)
    monitor_thread.daemon = True  # 设置为守护线程，程序退出时会自动结束
    monitor_thread.start()

    # 启动任务栏图标
    try:
        icon.run()  # 进入事件循环，监听任务栏点击事件
    except KeyboardInterrupt:
        # 捕获 Ctrl+C 退出时的操作
        print("KeyboardInterrupt detected. Exiting gracefully...")
        upload_foreground_app("程序结束")  # 如果需要可以上传状态
        stop_monitoring.set()  # 设置事件，停止监控线程
        monitor_thread.join()  # 等待监控线程退出
        icon.stop()  # 停止任务栏图标


if __name__ == "__main__":
    main()
